</code></pre>
    <p>The common language runtime (CLR) requires overloaded methods to have a unique parameter signature (same method name but different list of parameters). However, here you need two <code>Delete</code> methods -- one for GET and one for POST -- that both have the same parameter signature. (They both need to accept a single integer as a parameter.)</p>
    <p>There are two approaches to this problem, one is to give the methods different names. That's what the scaffolding mechanism did in the preceding example. However, this introduces a small problem: ASP.NET maps ");
            WriteLiteral(@"segments of a URL to action methods by name, and if you rename a method, routing normally wouldn't be able to find that method. The solution is what you see in the example, which is to add the <code>ActionName(&quot;Delete&quot;)</code> attribute to the <code>DeleteConfirmed</code> method. That attribute performs mapping for the routing system so that a URL that includes /Delete/ for a POST request will find the <code>DeleteConfirmed</code> method.</p>
